xpériences éducatives : en effet, par mon expérience de professeur à domicile mais également grâce aux élèves que je suivais les années précédentes aussi bien au collège qu\'au lycée et en école de commerce, il m\'a été donné d\'éprouver un large panel éducatif.\r\nTous mes cours sont assortis de documents et rigoureusement préparés. Je suis à la disposition de mes élèves par mail, webcam et téléphone. Je suis aussi là pour répondre à toutes questions annexes à la scolarité. Entraînement en situation d\'examen ou de concours (Diplôme National du Brevet, oral et écrit de l\'EAF, concours Tremplin et Passerelle) afin de se préparer dans des conditions optimales.\r\nN\'hésitez pas à me demander mes références (Education Nationale, école de commerce et cours particuliers).\r\nEn préparation de mon site (prévu pour mi-janvier 2016) : tarifs avantageux et conditions professionnelles de travail dans un local dédié !','COURS EN INDIVIDUEL :\r\n-- 40 € pour les collégiens,\r\n-- 50 € pour les lycéens,\r\n-- 60 € pour le supérieur.\r\nLe prix de la première heure de cours sera majoré de 5 euros pour un déplacement jusqu\'à 10km, de 10 euros pour un déplacement de plus de 10km.\r\nSi 10 heures sont payées d\'avance, une remise de 5% est appliquée.\r\n\r\nCOURS EN PETITS GROUPES DE TRAVAIL (de 5 à 6 élèves au maximum) :\r\n-- 55 € pour 2 heures (niveau collège).\r\n--100 € pour 4 heures (niveau collège).\r\n-- 75 € pour 2 heures (niveau lycée).\r\n-- 140 € pour 4 heures (niveau lycée).\r\n-- 95 € pour 2 heures (niveau supérieur).\r\n-- 180 € pour 4 heures (niveau supérieur).\r\nLes cours se déroulent dans un local dédié.\r\nSi 10 heures sont payées d\'avance, une remise de 5% est appliquée.\r\n\r\nSTAGES DE 10 HEURES SUR 5 JOURS EN PETITS GROUPES DE TRAVAIL (de 5 à 6 élèves au maximum) :\r\n-- 250 € (niveau collège).\r\n-- 350 € (niveau lycée).\r\n-- 450 € (niveau supérieur).\r\nLes cours se déroulent dans un local dédié.\r\nSi les 10 heures sont payées d\'avance, une remise de 5% est appliquée.','Mon parcours en quelques dates :\r\n2015-2016 : collaboratrice des éditions Le livre scolaire pour la rédaction du manuel scolaire de 3ème.\r\n2014-2016 : En charge des classes de 2de générales et 1ère S et L. Professeur principal et Coordinatrice du français au lycée. Intervenante en école de commerce pour la préparation au concours Passerelle et Tremplin.\r\n2014 : obtention de l\'Agrégation interne de Lettres Modernes.\r\n2013-2014 : Coordinatrice du français au collège.\r\n2007-2013 : Enseignante en lettres modernes et professeur principal. Depuis 2009, correctrice et examinatrice pour le Diplôme National du Brevet et le Baccalauréat.\r\n2006-2007 : Préparation au Capes de Lettres Modernes.\r\n2001-2006 : Etudiante. DEA (actuel Master 2) de philosophie esthétique. Mention Très bien avec félicitations du jury.\r\n2000-2001 : année sabbatique à l\'étranger.\r\n1998-2000 : Hypokhâgne et khâgne a/l au lycée Condorcet (75009).\r\n1998 : Bac littéraire en horaires aménagés au lycée Racine (75008). Mention Bien.',200,'50','250','5','950','10','1800',NULL,NULL,'','','48.8642858','2.37901880000004',10000,'75011','Paris','FR','78 Avenue de la République',NULL,NULL,NULL,'on',NULL,NULL,'2016-01-02 20:33:17',NULL,'2016-01-02 18:40:13','2016-01-02 20:33:17',NULL),(51,10,'cours-et-soutien-en-francais-et-lettres-modernes-par-professeur-agrege-de-maths-2','Cours et soutien en Français et Lettres modernes par professeur agrégé de Philosophie','En 2013, sur les 8 élèves que j\'ai aidés tout au long de l\'année pour préparer le Bac de maths, deux ont obtenu 20/20, un a obtenu 18/20, un autre 17/20, deux ont obtenu 16/20 ainsi que deux autres respectivement 15/20 et 14/20, soit une moyenne de 17/20.\r\n\r\nUn élève ayant obtenu 15/20 au Bac n\'avait jamais eu la moyenne en Première ni en Terminale.\r\n\r\nJe suis professeur particulier de mathématiques et coach scolaire depuis ma sortie de l\'ESSEC en 2006. J\'ai fait ce choix par désir d’indépendance et goût pour l\'enseignement.\r\n\r\nExerçant cette activité à temps plein, il ne m\'est pas possible de me déplacer chez mes élèves. Les cours ont donc lieu à mon domicile, entre les métro Odéon, Luxembourg et Cluny la Sorbonne.\r\n\r\nLors de notre premier cours, nous prendrons le prétexte de l\'actualité de l\'élève (DST, exercices, DM à rendre) pour faire un vrai premier cours et ainsi évaluer son niveau et ses besoins. Chaque élève est différent. Je m’adapte le plus possible à la psychologie de chacun. Au terme de ce premier cours, nous nous mettrons d\'accord sur un créneau horaire d\'1h30 (à 10h30, 13h, 14h45, 16h30 ou 18h15 du lundi au vendredi, ainsi que le dimanche à partir de 13h) afin que l\'élève puisse compter sur la régularité qui sera la clé de son succès. Je m\'engage alors à assurer ce cours toutes les semaines en période scolaire et ce, jusqu\'à ce que l\'élève n\'ait plus besoin de moi. En fonction des urgences, des cours supplémentaires pourront être ajoutés selon mes disponibilités et, en particulier, durant les vacances des stages individuels, intensifs de révision pourront être','Bonjour,\r\n\r\nEn 2013, sur les 8 élèves que j\'ai aidés tout au long de l\'année pour préparer le Bac de maths, deux ont obtenu 20/20, un a obtenu 18/20, un autre 17/20, deux ont obtenu 16/20 ainsi que deux autres respectivement 15/20 et 14/20, soit une moyenne de 17/20.\r\n\r\nUn élève ayant obtenu 15/20 au Bac n\'avait jamais eu la moyenne en Première ni en Terminale.\r\n\r\nJe suis professeur particulier de mathématiques et coach scolaire depuis ma sortie de l\'ESSEC en 2006. J\'ai fait ce choix par désir d’indépendance et goût pour l\'enseignement.\r\n\r\nExerçant cette activité à temps plein, il ne m\'est pas possible de me déplacer chez mes élèves. Les cours ont donc lieu à mon domicile, entre les métro Odéon, Luxembourg et Cluny la Sorbonne.\r\n\r\nLors de notre premier cours, nous prendrons le prétexte de l\'actualité de l\'élève (DST, exercices, DM à rendre) pour fa